css:
@-moz-document domain("lbpiaccess.com") {
body {
	   background-color: #373636; 
	}

div#login-maincontainer {
    background-color: #646464;
}

	div#header, div#footer {
	    background-color: #646464;
	}


	#login-body {
	    background-color: #373636;
	}

	div#login-contentcolumn {
	    background-color: #646464;
	}

	a {
	    color: #3efbda;
	}


div#login-forex {
  background-color: #646464;  
}

	div#login-wrapper {
	    background-color: #646464;
	}

	div#login-page > div.form {
	    background-color: #868686
	}

	p.message {
	    color: white !important;
	}

	div#leftcolumn div#cssmenu ul li {
	    background-color: #646464;   
	    
	}

	div#leftcolumn div#cssmenu ul li a{
	 color: #3efbda !important;    
	}

	div#content {
	    background-color: #646464;   
	}

	div#panelForm {
	    background-color: #868686;
	}

	div.ui-menu {
	    background-color: #868686;
	    font-weight: bold;
	}

	div.ui-tabs-panels, div.ui-panel, div.ui-widget {
	    background-color: #868686;
	}

	table, table td, td, div.ui-panel-titlebar {
	    background-color: #646464 !important ;
	}

	table td {
	    color: white;
	}

	table th {
	    color: #156456 !important; 
	}

	
	div.notice {
	    background-color: #c6c2c2;    
	}

	div.notice ul, div.notice ol {
	    color: #2f2f2f;
	}
}
